import React, { useEffect } from 'react';
import { useAuth0 } from '@auth0/auth0-react';

import './Profile.css';

function Profile(props) {
  useEffect(() => {
    //...
  });
  console.log(props);

  return (
    <div>
      <div className="header">
        <h2 className="header-greeting">Hello {props.user.name}</h2>
      </div>
      <div>
        <img
          className="header-pic"
          src={props.user.picture}
          alt="profile-picture"
        />
      </div>
      <div className="profile-form">
        <form onSubmit={(e) => e.preventDefault()}>
          <label htmlFor="name">
            <input type="text" name="name" id="name" />
          </label>
          <label htmlFor="name">
            <input type="text" name="name" id="name" />
          </label>
          <label htmlFor="name">
            <input type="text" name="name" id="name" />
          </label>
          <label htmlFor="name">
            <input type="text" name="name" id="name" />
          </label>
          <label htmlFor="name">
            <input type="text" name="name" id="name" />
          </label>
          <label htmlFor="name">
            <input type="text" name="name" id="name" />
          </label>
        </form>
      </div>
    </div>
  );
}

export default Profile;
